import { CHANGE_VIEW } from './types';

export const changeView = (value) => dispatch => {
    var newView = "";
    console.log(value)
    if (value === "tile")
        newView = "dashboard";
    else
        newView = "tile";
    dispatch({
        type: CHANGE_VIEW,
        payload: newView
    });
}
